import React, {useEffect, useState} from "react";
import { animateScroll as scroll } from "react-scroll";
import {
  Nav,
  NavbarContainer,
  NavLogo,
  NavMenu,
  NavItem,
  NavLinks,
  MobileIcon,
  NavSearch,
  NavBtn,
  NavBtnLink,
} from "./NavbarElements";
import { FaBars ,FaSearch,FaMapMarkerAlt} from "react-icons/fa";
import { useNavigate } from "react-router-dom";
import LogoTM from "../../../common/assets/untlogo.png";

import { GlobalStateContext } from '../../../GlobalStateContext';

const Navbar = ({ toggle }) => {
    const [state, dispatch] = useContext(GlobalStateContext);
  const navigate=useNavigate();
  const [scrollNav, setScrollNav] = useState(false)
  const changeNav = () => {
    if(window.scrollY >= 80){
      setScrollNav(true)
    }
    else{
      setScrollNav(false)
    }
  }
  const getLocationDetails =()=>{

  }

  useEffect(() => {
    getLocationDetails();
    window.addEventListener('scroll', changeNav)
  },[]);

  const toggleHome = () => {
    scroll.scrollToTop()
  }

  const handleAddVehicleDetails=(e)=>
  {
    e.preventDefault()
    navigate("/addvehicledetails");
  }

  return (
    <>
      <Nav scrollNav={scrollNav}>
        <NavbarContainer>
          <NavLogo onClick={toggleHome} to="/">
            <img src={LogoTM} alt="" />
          </NavLogo>
          <MobileIcon onClick={toggle}>
            <FaBars />
          </MobileIcon>
          <NavMenu>
          <NavItem>
              <NavSearch>
                <input type="text" placeholder="Search..." />
                <FaSearch />
              </NavSearch>
            </NavItem>
            <NavItem>
            <NavLinks  onClick={event => handleAddVehicleDetails(event)}smooth={true} duration={500} spy={true} exact='true' offset={-80} >Add Vehicle Information</NavLinks>
            </NavItem>
          </NavMenu>
          <NavItem>
          <FaMapMarkerAlt />
          <NavLinks to="/location-details">1201 W University Dr OPEN Until 11:00 PM</NavLinks>
        </NavItem>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
